import React from 'react';
import propTypes from 'prop-types';
import styled from 'styled-components';

const halfImage = styled.img`
	width: 50%;
`;
const PostImages = ({ images }) => {
	if (images.length === 1) {
		return (
			<>
				<img src="" alt="" />
			</>
		);
	}
	if (images.length === 2) {
		return (
			<>
				<img src="" alt="" />
				<img src="" alt="" />
			</>
		);
	}

	return <></>;
};

PostImages.propTypes = {
	images: propTypes.string,
};
